import React from "react";
import { useState } from "react";

const AddProduct = () => {
    const [name,setName] = useState('');
    const [price,setPrice] = useState('');
    const [category,setCategory] = useState('');
    const [company,setCompany] = useState('');
    return ( 
        <div>
            <h1>Add Product</h1>
            <input type="text" placeholder="Enter product name" className="inputBox" value={setName} onChange={(e)=>{setName(e.target.value)}} />
            <input type="text" placeholder="Enter product pricee" className="inputBox" value={setPrice} onChange={(e)=>{setPrice(e.target.value)}}/>
            <input type="text" placeholder="Enter product category" className="inputBox" value={setCategory} onChange={(e)=>{setCategory(e.target.value)}} />
            <input type="text" placeholder="Enter product company" className="inputBox"  value={setCompany} onChange={(e)=>{setCompany(e.target.value)}}/>

            <button >Add Product</button>
        </div>
     );
}
 
export default AddProduct;
